   [154]={next_id=155, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="此刻的辉月实际上仍然沉浸在小说里，在她眼里你就是那个所谓的唯一男主角。", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
