   [156]={next_id=157, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="虽然理论上你可以强行和拥有星源共鸣之人进行链接，但后果会有多严重伊西丝曾经警告过你，光是精神意识层面的破坏就足以让你痛不欲生……", msg_color="", msg_size=0, talker="", audio="", img="arts/ui/bg/story/storybg_10_104.jpg", video_url="", music_id="0", background_music="", model_tid={}, model_pos={}, model_move_pos={}, model_exit={}, model_show_effect={}, update_model={}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=0, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
