   [159]={next_id=160, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="辉月是我们所有命星骑士里年龄最小的一个，获得命星封号不到两个月。", msg_color="", msg_size=0, talker="蒂雅", audio="", img="arts/ui/bg/story/storybg_10_102.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "4509", 0, 1, 3, 215.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
